import React from "react";
import { useEffect } from "react";

function Yourprofile(){

    let theUser = null;
    useEffect(()=>{
    
        let fetchData = async()=>{
            let response = await fetch('/api/profile');
            let json = await response.json();

            if(response.ok){
                console.log(json)
                theUser = json.user;
            }
        }

        fetchData();

    }, [])

    return(
        <>
        <h3>{JSON.stringify(theUser)}</h3>
        </>
    );


}


export default Yourprofile;
